function HooksContainer  ()  {
  useSelector(state=>state.pizzaBase);

  return (
    <div className='container'>
        <h2 className='text'>Number of pizza available - 100</h2>
        <button className='btn' >Order pizza</button>
    </div>
  )
}


export default HooksContainer;
